import styled from 'styled-components'

import Doughnut from './Doughnut'

const Container = styled.div`
  display: flex;
  margin-top: 7rem;
`

const DoughnutAlarms = props => (
  <Container>
    <Doughnut />
  </Container>
)

export default DoughnutAlarms
